import Navigation from "./Navigation/Navigation";
import { Route, Switch } from "react-router-dom";
import Item from "./Product/Item";
const Home = () => {
  return (
    <>
      <Navigation />
      <Switch>
        <Route path="/" exact>
          <Redirect to="/item" />
        </Route>
        <Route path="/item" component={Item} exact />
      </Switch>
    </>
  );
};
export default Home;
